import Projects from './ProjectClass';
import { useState } from 'react';

export function ProjectsPage() {
    const [projectList, changeProjectList] = useState(new Projects());

    return(
        <div className="ProjectsPage">
            <h1>Projects</h1>
        
            <ProjectList projectList={projectList.projects}/>
        </div>
    );
}

function ProjectList(props) {
    var projectListItems = props.projectList ?
        props.projectList.map((project, id) => {
            return(
                <li key={id}>
                    <ProjectListItem name={project.name}/>
                </li>
            );
        }) :
        [];

    return(
        <ul className="ProjectList">
            {projectListItems}
        </ul>
    );
}

function ProjectListItem(props) {


    return(
        <div className="ProjectListItem">
            <button>{props.name}</button>
        </div>
    );
}

